      <div class="modal" id="modal">
        <div class="modal-dialog modal-sm-down">
          <div class="modal-content">
            <div class="modal-header">
              <h5 class="modal-title">COPRECY</h5>
              <button type="button" class="btn-close" data-bs-dismiss="modal"></button>
            </div>
            <div class="modal-body" id="modalbody">
              <p>Coprecy (Comunidade de Prevenção ao Cyberbullying) foi o nome dado ao projeto desenvolvido por meu grupo e
                eu durante o nosso curso técnico de informática no IFSP.</p>
              <p>Trata-se de um site informativo sobre a prevenção de bullying e cyberbullying. O objetivo era criar um site
                responsivo em html, css e php.</p><p>A parte com maior foco neste projeto foi o fórum disponível no site.</p>
              <p>Este fórum apresenta funções diferentes de acordo com o usuário:</p><ul><p><li>Se o usuário não tiver feito
                o login, ele pode apenas visualizar os fóruns criados.</li></p>
              <p><li>Se o usuário tiver feito o login, ele poderá visualizar todos os fóruns e criar/excluir seus próprios fóruns.</li></p>
              <p><li>O login possui um usuário e senha já criados diretamente no banco de dados para o administrador do fórum.
                Se o administrador fizer login, ele poderá visualizar e excluir QUALQUER fórum. Além de poder criar outros. Ademais,
                o administrador também possui o "poder" de excluir usuários.</li></p>
              <p><li> Se um usuário comum tentar acessar a página de administração (administracao.php) pela url, ele é direcionado
                para a página inicial (index.php).</li></p></ul><p>Estas questões foram pensadas com o objetivo de ter-se um certo
                controle sobre usuários e do que é postado na página de fóruns.</p><p>Por tratar-se do nosso primeiro projeto, há
                questões que podem ser aprimoradas. Porém, o objetivo do site foi combinar as linguagens para desenvolver um projeto
                voltado ao tema de bullying e cyberbullying, com mais foco na parte teórica.</p>
            </div>
